import React from 'react';
import '../css/Main.css';
import logo from '../img/logo.png';

function Main() {
    return (
      <div className="Main">
        <header className="Main-header">
            <table>
                <tr>
                    <td>Hello</td>
                </tr>
                <tr>
                    <td>Yus</td>
                </tr>
            </table>
            <img src={logo} className="rentfyLogoMain" alt="logo" />
        </header>
      </div>
    );
}

export default Main;
